import group7left from "../../images/footer/group7left.webp";
import group7right from "../../images/footer/group7right.webp";
import footerLeft from "../../images/footer/footerLeft.webp";
import line from "../../images/footer/line.svg";
import mask_title from "../../images/footer/mask_title.svg";
import ming from "../../images/footer/ming.svg";
import logo from "../../images/footer/logo_twitter.webp";

const Footer = () => {
  return (
    <div className="bg-[#313244] lg:bg-white text-center">
      <div className="flex">
        <div className="flex h-fit">
          <img className="w-[50px]" src={mask_title} alt="" />
          <p>CREATED BY</p>
          <img src={ming} alt="" />
        </div>
        <div>
          <img src={line} alt="" />
        </div>
        <div className="flex h-fit">
          <p>JOIN US</p>
          <img className="w-[50px]" src={mask_title} alt="" />
        </div>
      </div>

      <div>
        <span className="text-[#a5b4bd]">Terms & Condition</span>
      </div>
      <div className="flex mx-4 justify-evenly">
        <div className="w-1/3">
          <img className="w-[60px]" src={group7left} alt="" />
          <img src={footerLeft} alt="" />
        </div>
        <div className="">
          <p className="text-white font-extrabold text-xs lg:text-black md:text-lg">
            Licensed By WeAbove
          </p>
        </div>
        <div className="w-1/3">
          <img
            className="w-[60px] ml-[80%] lg:ml-[83%] xl:ml-[85%] 2xl:ml-[89%]"
            src={group7right}
            alt=""
          />
          <img src={footerLeft} alt="" />
        </div>
      </div>
      <span className="text-[#fc4a6a]">Â© WEABOVE 2022</span>
    </div>
  );
};

export default Footer;
